A presente justificativa tem como objetivo demonstrar a necessidade da contratação de Assessoria Técnica Especializada em Perícia Contábil para a realização de cálculos técnicos e revisão da folha de pagamento, considerando os efeitos do Dissídio Coletivo de Greve - Processo nº 1004124-61.2022.5.02.0000, do Tribunal Regional do Trabalho da 2ª Região, e seu impacto na remuneração dos trabalhadores abrangidos.

Contextualização da Necessidade

O Dissídio Coletivo de Greve resultou em decisões judiciais que impactaram diretamente a folha de pagamento dos empregados da Administração, exigindo a revisão dos cálculos aplicados nos anos de 2021 a 2025. Entre os principais efeitos dessa decisão, destacam-se:

Determinação de reajustes salariais e reflexos financeiros em verbas trabalhistas e previdenciárias;

Compensação de dias paralisados e impactos na folha de pagamento;

Possibilidade de pagamentos retroativos e ajustes nos cálculos de encargos;

Adequação da folha aos parâmetros estabelecidos pela Justiça do Trabalho.

Diante dessas exigências, a Administração necessita de análises detalhadas e cálculos técnicos especializados, garantindo a correta aplicação da decisão judicial, prevenindo inconformidades e evitando riscos de passivos trabalhistas.

Justificativa Técnica da Contratação 

A complexidade dos cálculos envolvidos na revisão da folha de pagamento exige conhecimento técnico especializado em contabilidade trabalhista, perícia contábil e auditoria de folha de pagamento no setor público. Dessa forma, torna-se necessária a contratação de empresa ou profissional especializado para:

Realizar auditoria e conferência detalhada dos valores pagos antes e após o dissídio coletivo;

Emitir relatórios técnicos demonstrando os impactos financeiros da decisão judicial;

Apontar eventuais correções necessárias para a adequação da folha de pagamento;

Fornecer suporte técnico para a Administração Pública na correta aplicação da decisão judicial.
